        <ProductView>
            <PreviewContainer>
                <ImagesPreview images={[img1, img2, img3]} setMainImg={setMainImg} />
            </PreviewContainer>
            <ImageContainer>
                <ImageComponent src={mainImg} />
            </ImageContainer>
            <DetailsContainer>
                <ProductDetails dataProduct={product} />
            </DetailsContainer>
            <LessorContainer>
                <LessorInfo dataLessor={dataLessor} />
            </LessorContainer>
            <ButtonContainer>
                <button >RENTAR PRODUCTO</button>
            </ButtonContainer>
        </ProductView>
    );
}

